import React from 'react';
import { 
    Timeline, 
    TimelineItem, 
    TimelineSeparator, 
    TimelineDot, 
    TimelineConnector, 
    TimelineContent 
  } from '@mui/lab';

  // import TimelineOppositeContent, {
  //   timelineOppositeContentClasses,
  // } from '@mui/lab/TimelineOppositeContent';

  import { timelineContentClasses } from '@mui/lab/TimelineContent';


const Experience = () => {
  return (
    <Timeline
    sx={{
      [`& .${timelineContentClasses.root}`]: {
        flex: 0.2,
      },
    }}>
      <TimelineItem>
      <TimelineOppositeContent color="textSecondary">
          09:30 am
        </TimelineOppositeContent>
        <TimelineSeparator>
          <TimelineDot />
          <TimelineConnector />
        </TimelineSeparator>
        <TimelineContent>Eat</TimelineContent>
      </TimelineItem>
      <TimelineItem>
      <TimelineOppositeContent color="textSecondary">
          09:30 am
        </TimelineOppositeContent>
        <TimelineSeparator>
          <TimelineDot />
          <TimelineConnector />
        </TimelineSeparator>
        <TimelineContent>Code</TimelineContent>
      </TimelineItem>
      <TimelineItem>
      <TimelineOppositeContent color="textSecondary">
          09:30 am
        </TimelineOppositeContent>
        <TimelineSeparator>
          <TimelineDot />
        </TimelineSeparator>
        <TimelineContent>Sleep</TimelineContent>
      </TimelineItem>
    </Timeline>
  );
};

export default Experience;



